import React from "react";
const ListComp=(props)=>{
    return (
    <>
    <Button  className="btn" variant="contained" color="primary">
                    <DeleteIcon className='delete'/>
    </Button>
    <li>{props.text}</li>
    </>);
    
}
export default ListComp;
